import logo from './logo.svg';
import './App.css';
import User from './Student';
import User1 from './Student1';
import Usam from './Student2';
import Aria from './Student3';


function App() {
  return (
    <div className="App">
  <User/><br></br><br></br><br></br><br></br>
  <User1/><br></br><br></br><br></br><br></br>
  <Usam/><br></br><br></br>
  <Aria/>
    </div>
  );
}

export default App;
